import React from 'react'
import './Not_found.css'

const NotFound = () => {

    return (
        <div className = "page_not_found">
            <h3>404 страница не найдена</h3>
            <p>Страница, которую вы ищите, не существует</p>
        </div>
    );
};

export default NotFound
